import React from 'react'
import pokemons from './data'
import Pokemon from './Pokemon'
import Pokedex from './Pokedex'
import './App.css'

function App() {

  return(
    <div>
      <h1>Pokemons</h1>
      <Pokemon cadaPokemon={pokemons}/>
      <Pokedex />
    </div>
  )
}

export default App;
